  factorial(n: number){
    if(n == 1){
      return 1;
    }
    else{
      return n * this.factorial(n-1) ;
    }

  }
  
  /**
   * Map.prototype.has(key)
   *  KPIID: number;
      NodeID: number;
      ScheduleDate: string;
      KPIValue: number;
      OperationID: number;
      type 1 is for grand total node type (CO2 or CH4)
      type 2 is for grand total activity node type (CO2 or CH4)
   */
  createHashMap(type:number) {
    this.kpiMap = new Map();
    var i ;
    var key;
    for (i=0; i < this.mappedKPIs.length;i++) {
       key = (type === 1 ) ? this.mappedKPIs[i].OperationID + '-' + this.mappedKPIs[i].KPIID  + '-' + this.mappedKPIs[i].ScheduleDate
                    : this.mappedKPIs[i].OperationID + '-' + this.mappedKPIs[i].KPIID  + '-' + this.mappedKPIs[i].ScheduleDate + '-' + this.mappedKPIs[i].ActivityNodeName;
      if (!this.kpiMap.has(key)) {
        this.kpiMap.set(key,this.mappedKPIs[i].KPIValue);
        // console.log(key);
      }
      //setting the new value when key already exists, keeping a summation
      else{
        this.kpiMap.set(key,this.kpiMap.get(key) + this.mappedKPIs[i].KPIValue);   
      }
    }
    for(let key of this.kpiMap.keys()){
      console.log(key);
    }
     var mapAsc = new Map([...this.kpiMap.entries()].sort());
    // console.log(this.kpiMap);
    console.log(mapAsc);
  }
